referred to as radiotherapy, irradiation, or x-ray therapy. Radiation therapy involves using high-energy particles of waves such as x-rays, gamma rays, electron beams, or protons, to destroy or damage cancer cells. Chemotherapy Chemotherapy involves using medicines or drugs to kill or damage cancer cells that have spread outside of the primary tumour area. There are three main goals of chemotherapy which are: To cure and stop the cancer from coming back To control the growth of the cancer To palliate the cancer which means to ease the symptoms of the cancer In women with large tumours, chemotherapy may be used before surgery to reduce the size or shrink the tumour so that a lumpectomy becomes an option to mastectomy. The common long term side-effects of chemotherapy include early menopause and weight gain. The most common short term side-effects include hair loss, nausea, vomiting and weakened nails. Hormone Therapy Hormone therapy involves slowing down or stopping the growth of the tumour by preventing the cancer cells from getting the hormones like oestrogen and/or progesterone which they need to grow. Hormone therapy is usually given after breast surgery, but in some postmenopausal women, it may be administered before surgery to shrink the tumour so that a lumpectomy becomes an option to mastectomy Targeted Therapy Targeted cancer therapy is a fairly new cancer treatment which used drugs to precisely identify and attack cancer cells. It is designed to attack a certain molecular agent or pathway involved in the development of cancer. Unlike chemotherapy, targeted therapies kill cancer cells with little harm to healthy cells. [4] Ultimately the type of treatment plan you choose to follow is up to you. Many different women have chosen different paths, and they have survived. Being able to choose your own treatment plan empowers you and offers you some form of control over a condition that you can’t control. Ensure your doctor provides all the possible treatment opti