ased on this information, your doctor will be able to explain to you the key information relevant to your condition which include tumour size, tumour grade, and if your cancer is non-invasive or invasive. 2. Tumour Size In general, the smaller the tumour size, the better the prognosis (outlook). 3. Tumour Grade In the case of invasive breast cancers, the pathologist will compare how different the cancer cells are to normal breast cells. The more the cancer cells look like normal breast cells, the better the prognosis (outlook). 4. Non-Invasive vs Invasive The pathologist will determine if the cancer is Non-Invasive, meaning it is contained within the milk ducts or it is Invasive, meaning it has spread (metastasize) beyond the breast. 5. Nuclear Grade The pathologist will compare how different or closely the nuclei of cancer cells look to the nuclei of normal breast cells. The higher the nuclei grade, the more abnormal the cells are and more aggressive they tend to be. 6. Hormone Receptor Status The hormone receptor status will help guide your treatment plan. If your hormone receptor status is positive, your treatment plan will include hormone therapy such as tamoxifen or aromatase inhibitors. 7. HER2 Status (Human Epidermal Growth Factor Receptor 2) This

