final stages of the surgery, your breast surgeon will check the surgery areas for bleeding and insert surgical drains. Drains are long tubes that are inserted into your breast area or armpit to collect excess fluid that can accumulate in the space where the tumour was. The tubes have plastic bulbs on the ends to create suction, which helps the fluid to exit your body. After the drains are inserted, your surgeon will stitch the incision closed. The surgery site will then be covered by a bandage that wraps closely around your chest. [2] After Surgery You’ll be moved to a recovery room where medical staff can monitor your heart rate, body temperature, and blood pressure. If you are in pain or feel nauseous from the anaesthesia, let your medical team know so that you can be given medication. You will then be moved to a hospital room. You may expect to stay in hospital for 3 days or less. If you had a mastectomy and breast reconstruction at the same time, you may have to stay in the hospital for longer. [3] Preparing for Your Recovery Immediately after your surgery and during your recovery period, you may feel pain, soreness, tired, or experience bloating or swelling. You may find it difficult and painful to move about or extend your arms past a certain point. Therefore, doing some of the simplest things like showering or making yourself a meal may be challenging. Understanding all this is part of the healing phase and being well prepared for it will make your recovery period easier and more comfortable. Line up help – Arrange for a friend or family member to drive you home after the surgery as the medication you receive post-op may slow your responses. Speak to friends and family who will be able to provide assistance and support when you’re stuck at home recovering. Take care of personal matters – There will be a host of things which you may not be able to do immediately after your surgery, so it’s best to do it way ahead of time; like going to the dentist, getting a h